import "./App.css";
import { Route, Routes } from "react-router-dom";
import Home from "./pages/HomeLogin/Home.login";

export default function App() {
  return (
    <div>
      <Routes>
        <Route path="/" element={<Home />}/>
      </Routes>
    </div>
  );
}
